import React, { useState, useEffect } from 'react';

const Climb = () => {
  const [climbs, setClimbs] = useState([]);
  const [isLoading, setIsLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    const fetchClimbs = async () => {
      try {
        const response = await fetch('/climbs');
        if (!response.ok) {
          throw new Error('Failed to fetch climbs');
        }
        const data = await response.json();
        setClimbs(data);
        setIsLoading(false);
      } catch (err) {
        setError(err.message);
        setIsLoading(false);
      }
    };

    fetchClimbs();
  }, []);

  if (isLoading) {
    return (
      <div className="p-4 bg-white shadow rounded-lg">
        <h2 className="text-xl font-semibold mb-4">Climbs</h2>
        <p>Loading climbs...</p>
      </div>
    );
  }

  if (error) {
    return (
      <div className="p-4 bg-white shadow rounded-lg">
        <h2 className="text-xl font-semibold text-red-500 mb-4">Error</h2>
        <p>Error: {error}</p>
      </div>
    );
  }

  return (
    <div className="bg-white shadow rounded-lg overflow-hidden">
      <h2 className="text-xl font-semibold p-4 bg-gray-50 border-b">Climbs</h2>
      <div className="p-4">
        {climbs.length === 0 ? (
          <p>No climbs found.</p>
        ) : (
          <div className="overflow-x-auto">
            <table className="w-full border-collapse">
              <thead>
                <tr className="bg-gray-100">
                  {Object.keys(climbs[0]).map((key) => (
                    <th key={key} className="p-2 border text-left font-semibold text-gray-700">
                      {key}
                    </th>
                  ))}
                </tr>
              </thead>
              <tbody>
                {climbs.map((climb, index) => (
                  <tr key={index} className="hover:bg-gray-50 border-b last:border-b-0">
                    {Object.values(climb).map((value, colIndex) => (
                      <td key={colIndex} className="p-2">
                        {value}
                      </td>
                    ))}
                  </tr>
                ))}
              </tbody>
            </table>
          </div>
        )}
      </div>
    </div>
  );
};

export default Climb;
